import React from 'react';

const Mode = () => {
    const myStyle = {
        color: "white",
        backgroundColor: "DodgerBlue",
        padding: "10px",
        fontFamily: "Sans-Serif",
        width:'500px',
        height:'500px',
        margin:'100px'
      };
  return(
  <>
<div style={myStyle}>
<h3>
    hello dark mode
    <button>mode</button>
</h3>
</div>
  </>
  );
};

export default Mode;
